import React from "react";

function Inicio() {
  return (
    <div className="container">
      <h1>Inicio</h1>
      <hr />
      <div
        className="mt-4 p-5 rounded"
        style={{ backgroundColor: "lightgray" }}
      >
        <h1>Ejercicio Integrador</h1>
        <p>Practica simulacro parcial...</p>
      </div>
    </div>
  );
}

export { Inicio };
